from config import app, db
from models import User, Friendship, Post, Chat, Comment, Message
from faker import Faker
from random import randint, choice
import ipdb

if __name__ == "__main__":
    fake = Faker()
    #ipdb.set_trace()
    with app.app_context():
        # ipdb.set_trace()
        statuses = ['friends', 'married', 'brother', 'sister', 'mother', 'father', 'engaged']
        states = ["Alaska", "Alabama", "Arkansas", "American Samoa", "Arizona", "California", "Colorado", "Connecticut", "District ", "of Columbia", "Delaware", "Florida", "Georgia", "Guam", "Hawaii", "Iowa", "Idaho", "Illinois", "Indiana", "Kansas", "Kentucky", "Louisiana", "Massachusetts", "Maryland", "Maine", "Michigan", "Minnesota", "Missouri", "Mississippi", "Montana", "North Carolina", "North Dakota", "Nebraska", "New Hampshire", "New Jersey", "New Mexico", "Nevada", "New York", "Ohio", "Oklahoma", "Oregon", "Pennsylvania", "Puerto Rico", "Rhode Island", "South Carolina", "South Dakota", "Tennessee", "Texas", "Utah", "Virginia", "Virgin Islands", "Vermont", "Washington", "Wisconsin", "West Virginia", "Wyoming"]
        image = 'data:image/jpeg;base64,'
        banner = 'https://img.freepik.com/premium-photo/wide-banner-with-many-random-square-hexagons-charcoal-dark-black-color_105589-1820.jpg'
        print('Starting seed...')
        print('Deleting all records...')
        User.query.delete()
        Friendship.query.delete()
        Post.query.delete()
        Chat.query.delete()
        Comment.query.delete()
        Message.query.delete()
        db.session.commit()
        print('Creating records...')
        users = [User(username=fake.user_name(), password_hash = fake.domain_word(), email=fake.free_email(), bday=fake.date(), phone=fake.phone_number(), city=fake.city(), country=fake.country(), state=choice(states)) for i in range(50)]
        posts = [Post(endorse=choice(range(20)), renounce=choice(range(20)), str_content=fake.paragraph(nb_sentences=5), pic_content=image, price=choice(range(200)), is_sold=False, type='sale', user=choice(users)) for i in range(100)]
        db.session.add_all(users + posts)
        db.session.commit()
        pulled_users = User.query.all()
        pulled_posts = Post.query.all()
        friendships = []
        for i in range(100):
            user1 = choice(pulled_users)
            user2 = choice([user for user in pulled_users if user != user1])
            f = Friendship(status=choice(statuses), user1_id=user1.id, user2_id=user2.id)
            friendships.append(f)
        comments = [Comment(content=fake.paragraph(nb_sentences=1), likes=choice(range(20)), user=choice(pulled_users), post=choice(pulled_posts)) for i in range(200)]
        chats = []
        for i in range(80):
            user1 = choice(pulled_users)
            user2 = choice([user for user in pulled_users if user != user1])
            c = Chat(theme='normal', font='normal', font_size=12, user1_id=user1.id, user2_id=user2.id)
            chats.append(c)
        messages = [Message(content=fake.paragraph(nb_sentences=choice(range(5))), reactions=fake.emoji()) for i in range(1000)]
        db.session.add_all(friendships + chats + messages + comments)
        db.session.commit()
        print('Complete.')